import React from 'react';
import "../styles/HeartMed.css";
import HeartMed_image from "../images/Heart_Med-removebg-preview.png"
const HeartMed = () => {
  const [isLoading, setIsloading] = useState(false);
  // State to manage form data
  const [formData, setFormData] = useState({
    Year: "",
    Present_Price: "",
    Kms_Driven: "",
    Fuel_Type: "",
    Seller_Type: "",
    Transmission: "",
    Owner: "",
  });
  // State to manage prediction result
  const [result, setResult] = useState("");
  // State to manage displaying result
  const [showSpan, setShowSpan] = useState(false);

  const handleChange = (event) => {
    const value = event.target.value;
    const name = event.target.name;
    let inputData = { ...formData };
    inputData[name] = value;
    setFormData(inputData);
  };

  // Function to handle the 'Predict Selling Price' button click
  const handlePredictClick = () => {
    const url = "http://localhost:5000/predict";
    setIsloading(true);
    const jsonData = JSON.stringify(formData);
    // Fetch request to the Flask backend
    fetch(url, {
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      method: "POST",
      body: jsonData,
    })
      .then((response) => response.json())
      .then((response) => {
        setResult(response.Prediction);
        setIsloading(false);
        setShowSpan(true);
      });
  };
  
  return (
    <div className="container">
      <div className="sidebar">
        <h2>Dash Board</h2>
        <ul>
          <li><a href="home.html">Report</a></li>
          <li><a href="#">Patient checkup</a></li>
          <li><a href="Severity analysis.html">Severity analysis</a></li>
          <li><a href="#">BMI calculator</a></li>
          <li><a href="feedback.html">Feedback</a></li>
          <li><a href="#">Support</a></li>
        </ul>
      </div>
      <div className="main">
        <div className="header">
          <img src={HeartMed_image} alt="Heart Med Logo" />
          <div className="user-info">
            <i className="fa fa-user"></i>
          </div>
        </div>
        <div className="form-container">
          <h3>Please provide your details:</h3>
          <div className="input-group">
            <label htmlFor="age">Age:</label>
            <input type="number" id="age" name="age" min="1" max="100" required />
          </div>
          <div className="input-group">
            <label htmlFor="sex">Sex:</label>
            <select id="sex" name="sex" required>
              <option value="male">Male</option>
              <option value="female">Female</option>
            </select>
          </div>
          <div className="input-group">
            <label htmlFor="fasting_blood_sugar">Fasting blood sugar:</label>
            <input type="number" id="fasting_blood_sugar" name="fasting_blood_sugar" />
          </div>
          <div className="input-group">
            <label htmlFor="slope">Slope:</label>
            <input type="number" id="slope" name="slope" />
          </div>
          <div className="input-group">
            <label htmlFor="resting_electrocardiograph">Resting electrocardiograph:</label>
            <input type="number" id="resting_electrocardiograph" name="resting_electrocardiograph" />
          </div>
          <div className="input-group">
            <label htmlFor="ca">Ca:</label>
            <input type="number" id="ca" name="ca" />
          </div>
          <div className="input-group">
            <label htmlFor="chest_pain">Chest pain:</label>
            <input type="number" id="chest_pain" name="chest_pain" />
          </div>
          <div className="input-group">
            <label htmlFor="the_person_s_maximum_heart_rate">The person's maximum heart rate:</label>
            <input type="number" id="the_person_s_maximum_heart_rate" name="the_person_s_maximum_heart_rate" />
          </div>
          <div className="input-group">
            <label htmlFor="thalassemia">Thalassemia:</label>
            <input type="number" id="thalassemia" name="thalassemia" />
          </div>
          <div className="input-group">
            <label htmlFor="trestbps">Trestbps:</label>
            <input type="number" id="trestbps" name="trestbps" />
          </div>
          <div className="input-group">
            <label htmlFor="exercise_induced_angina">Exercise induced angina:</label>
            <input type="number" id="exercise_induced_angina" name="exercise_induced_angina" />
          </div>
          <div className="input-group">
            <label htmlFor="cholesterol">Cholesterol:</label>
            <input type="number" id="cholesterol" name="cholesterol" />
          </div>
          <div className="input-group">
            <label htmlFor="oldpeak">Old peak:</label>
            <input type="number" id="oldpeak" name="oldpeak" />
          </div>
          <button type="submit">PREDICT</button>
        </div>
      </div>
    </div>
  );
}

export default HeartMed;
